import React, { useEffect, useState } from 'react';
import io from 'socket.io-client';
import LandingPage from './LandingPage';
import Login from './Login';
import Register from './Register';
import Dashboard from './Dashboard';
import api from './api';

const socket = io('http://localhost:4000');

export const SocketContext = React.createContext();

function App(){
  const [notifications, setNotifications] = useState([]);
  const [user, setUser] = useState(null);
  const [currentPage, setCurrentPage] = useState('landing'); // 'landing', 'login', 'register', 'dashboard'

  useEffect(()=> {
    const raw = localStorage.getItem('church_user');
    if (raw) {
      const userData = JSON.parse(raw);
      setUser(userData);
      setCurrentPage('dashboard');
      api.setToken(userData.token);
    }

    socket.on('new_booking', (booking) => addNotification({ type:'new_booking', text: `New booking: ${booking.service_type} on ${booking.date} (${booking.time_slot})`}));
    socket.on('booking_deleted', (info) => addNotification({ type:'deleted', text: `Booking cancelled for ${info.date}`}));
    socket.on('calendar_config_updated', (info) => addNotification({ type:'config', text: `Calendar updated: ${info.date} max slots ${info.max_slots}`}));

    return ()=> {
      socket.off('new_booking');
      socket.off('booking_deleted');
      socket.off('calendar_config_updated');
    }
  },[]);

  const addNotification = (n) => setNotifications(prev => [n,...prev].slice(0,20));

  const handleLogin = (user, token) => {
    const u = { ...user, token };
    localStorage.setItem('church_user', JSON.stringify(u));
    api.setToken(token);
    setUser(u);
    setCurrentPage('dashboard');
  }

  const handleLogout = () => {
    localStorage.removeItem('church_user');
    api.setToken(null);
    setUser(null);
    setCurrentPage('landing');
  }

  const handleChooseAuth = (type) => {
    setCurrentPage(type); // 'login' or 'register'
  }

  return (
    <SocketContext.Provider value={socket}>
      {currentPage === 'landing' && (
        <LandingPage 
          onChooseLogin={() => handleChooseAuth('login')}
          onChooseRegister={() => handleChooseAuth('register')}
        />
      )}
      {currentPage === 'login' && (
        <div style={{ minHeight: '100vh', background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', display: 'flex', alignItems: 'center', justifyContent: 'center', padding: '20px' }}>
          <div style={{ width: '100%', maxWidth: '450px' }}>
            <button 
              onClick={() => setCurrentPage('landing')}
              style={{ background: 'rgba(255,255,255,0.2)', color: 'white', border: 'none', padding: '10px 20px', borderRadius: '6px', cursor: 'pointer', marginBottom: '24px', fontWeight: 600 }}
            >
              ← Back
            </button>
            <Login onLogin={handleLogin} />
            <p style={{ textAlign: 'center', color: 'rgba(255,255,255,0.8)', marginTop: '24px', fontSize: '14px' }}>
              Don't have an account? <button onClick={() => handleChooseAuth('register')} style={{ background: 'none', border: 'none', color: 'white', fontWeight: 600, cursor: 'pointer', textDecoration: 'underline' }}>Create one</button>
            </p>
          </div>
        </div>
      )}
      {currentPage === 'register' && (
        <div style={{ minHeight: '100vh', background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', display: 'flex', alignItems: 'center', justifyContent: 'center', padding: '20px' }}>
          <div style={{ width: '100%', maxWidth: '450px' }}>
            <button 
              onClick={() => setCurrentPage('landing')}
              style={{ background: 'rgba(255,255,255,0.2)', color: 'white', border: 'none', padding: '10px 20px', borderRadius: '6px', cursor: 'pointer', marginBottom: '24px', fontWeight: 600 }}
            >
              ← Back
            </button>
            <Register onRegister={handleLogin} />
            <p style={{ textAlign: 'center', color: 'rgba(255,255,255,0.8)', marginTop: '24px', fontSize: '14px' }}>
              Already have an account? <button onClick={() => handleChooseAuth('login')} style={{ background: 'none', border: 'none', color: 'white', fontWeight: 600, cursor: 'pointer', textDecoration: 'underline' }}>Sign in</button>
            </p>
          </div>
        </div>
      )}
      {currentPage === 'dashboard' && user && (
        <Dashboard 
          user={user}
          notifications={notifications}
          onLogout={handleLogout}
          addNotification={addNotification}
        />
      )}
    </SocketContext.Provider>
  )
}

export default App;
